import React from 'react';
import './Quote.css';
import Media from 'react-media';

// Register Quote Component 
export default function REturnQuOteRegister() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => {
 return (
  <div className='wrp-quote-regiter'>
   <h1>
    <span>
     <span className='red-ungamamoney'>Muungano</span>
     <span className='yellow-ungamamoney'>Money</span></span>

    <span>Features</span>
   </h1>
   <p>
    Pour l'enregistrement dans le système, il est nécessaire
    d'entrer votre nom. Le nom peut être n'importe quelle combinaison
    de lettres. Le nom n'est pas une connexion pour entrer
    dans le système.
   </p>
  </div>
 );
};
export const ScreenSmall = () => (
 <div></div>
);
